description:
Verenigde Staten
Drama / Thriller
105 minuten

geregisseerd door John Curran
met Edward Norton, Robert De Niro en Milla Jovovich

Een veroordeelde brandstichter krijgt het aan de stok met zijn reclasseringsambtenaar. Om zijn vrijheid veilig te stellen speelt hij enkele psychologische spelletjes met deze man, maar wanneer de reclasseringsambtenaar zelf een affaire begint met de vrouw van de veroordeelde loopt het pas echt uit de hand.

